 import React from "react";

const Home = () => {
  return (
    <div className="container mt-4">
      <h1>Benvenuto su TravelPlanner</h1>
      <p>Accedi o registrati per iniziare a pianificare i tuoi viaggi!</p>
    </div>
  );
};

export default Home;
